import React, { Component } from "react";
import { Form, Button } from "react-bootstrap";

import "./Login.css";

export default class Login extends Component {
  constructor() {
    super();

    this.state = {
      user_name: "",
      password: ""
    };
  }



  handleChange = (e) => {
    this.setState({
      [e.target.name]: e.target.value
    })
  }

  render() {
    return (
        <Form onSubmit={this.handleSubmit}>
        <Form.Group controlId="formBasicEmail">
          <Form.Label>Username</Form.Label>
          <Form.Control type='text' name="user_name" placeholder="Username" onChange={this.handleChange} value={this.state.user_name}/>

        </Form.Group>

        <br></br>

        <Form.Group controlId="formBasicPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control type='password' name="password" placeholder="Password" onChange={this.handleChange} value={this.state.password}/>
        </Form.Group>
        <Button variant="primary" type="submit">
          Submit
        </Button>
      </Form>
    );
  }
}
